social_posts.post_text:
you’re probably wondering what’s going on ! soooo yesterday .. i literally left free stoner coloring books all around manhattan 🥹✨ this was honestly an experience i enjoyed sooo much . i’m trying to become more comfortable recording myself in public and not thinking about what anyone else is doing or saying . so here’s to more days filled with self love and doing things that bring me joy . i do hope whoever finds my books needed a smile and their day was made , i do want to travel more and do this in different cities as well . thank you for all the support . 

all of my stoner coloring books are available on my website as well , i’m also manifesting my books in UO stores as well 🥹❤️ 

locations are: @urbanoutfitters 628 Broadway
@buffaloexchange 26th street
@michaelsstores 23rd street
@traderjoes 23rd street 
#manhattan #nycgirl #scavengerhunt #stonerart #coloringbookforadults #traderjoesfinds #urbanoutfitters #artistsoninstagram #selfcareday
